import React from 'react';

import HatsItem from '../hats-item/hats-item.component'

import Shop_Data from '../../pages/shop/shop.data';

class Hats extends React.Component {
    constructor() {

        super();

        this.state = {
            hatsdata:Shop_Data[0]
        }
    }

    render() {
        return (
          <div className='hats-menu'>
            {this.state.hatsdata.map(({ id, ...otherSectionProps }) => (
              <HatsItem key={id} {...otherSectionProps} />
            ))}
          </div>
        );
      }
    }

export default Hats;
